import { IUser } from '../interfaces/IUser';
import api from '../services/api';
import {getUser} from '../services/api_services';
import './InfoUser.css'

export interface IInfoUserProps {

}

export function InfoUser (props: IInfoUserProps) {

  const [resp, setResp] = useState<IUser>();
  var url = window.location.href[window.location.href.length -1]
  api
      .get("/v1/Users/" + url)
      .then((response) => ((setResp(response.data))))
      .catch((err) => {
        console.error("ops! ocorreu um erro" + err);
      });

  return (
    <div className='body'>
      <div className='card p-4'>
        <div className='card-title text-start fs-5'>
          Cliente: {resp?.name}
        </div>
        <hr />
        <div className='card-body'>
          <h3>Informações</h3>
          <div className='row'>
            <div className='col'>
              <div>
                <strong>id: {resp?.id}</strong>
              </div>
            </div>
            <div className='col'></div>
          </div>

        </div>

      </div>
    </div>
  );
}
